spx.forEach(function(d){
  d.dd=new Date(+d.date * 24 * 60 * 60 * 1000);
});

spxcf = crossfilter(spx);
var rsi = spxcf.dimension(function(d){return Math.round(d.rsi);});
var countByRSI = rsi.group().reduceCount();

var rsi2 = spxcf.dimension(function(d){return Math.round(d.rsi);});
var perfByRSI = rsi2.group().reduce(
  function(p,v){
    ++p.count;
    p.sum += v.ret;
    return p;
  },
  function(p,v){
    --p.count;
    p.sum -= v.ret;
    return p;
  },
  function(){
    return {count:0,sum:0};//,sum:0,arith:0,geom:0};
  }
);

var year = spxcf.dimension(function(d){return d3.time.year(d.dd).getFullYear();});
var sumByYear = year.group().reduceSum(function(d){return d.rsi});

dc.barChart("#bar-count")
        .width(500)
        .height(250)
        .dimension(rsi)
        .group(countByRSI)
        //.valueAccessor(function(p){return p.value.count;})
        .x(d3.scale.linear().domain([0, 100]))
        .y(d3.scale.linear().domain([0, 500]))
        .centerBar(true);
        
dc.lineChart("#line-year")
        .width(500)
        .height(250)
        .dimension(year)
        .group(sumByYear)
        .keyAccessor(function(d){return Date.parse(d.key + "-01-01")})
        //.valueAccessor(function(p){return p.value.sum;})
        .x(d3.time.scale().domain([Date.parse("1950-01-01"),Date.parse("2013-12-31")]))
        .elasticY(true)
        .xUnits(d3.time.years)
        .renderArea(true)
        //.xAxis().ticks(5);

dc.lineChart("#line-perf")
        .width(500)
        .height(250)
        .dimension(rsi2)
        .group(perfByRSI)
        .valueAccessor(function(p){return p.value.sum;})
        .x(d3.scale.linear().domain([0,100]))
        .elasticY(true)
        //.xUnits(d3.time.hours)
        .renderArea(true)
        //.xAxis().ticks(5);

dc.renderAll();
</script>
